import { Component } from '@angular/core';
import { JwtClientService } from '../jwt-client.service';

@Component({
  selector: 'app-employee-task-manger',
  templateUrl: './employee-task-manger.component.html',
  styleUrls: ['./employee-task-manger.component.css']
})
export class EmployeeTaskMangerComponent {
  task;
  constructor(private service:JwtClientService){
    const employee:any=service();
    this.task=employee.task;
    console.log(employee)
    console.log("inside task manager ",this.task);
  }
}
